import React, {Component} from 'react';
import './App.css';

class App extends Component{
  render(){
    var a = 5 ;
    var name = 'Tinh';
    var b =7;
    var product = {
      id : 1,
      name : 'Iphone 7 Plus',
      price : 15000000
    };
      return (
        <div>
          <nav className="navbar navbar-inverse">
            <div className="container">
              <a className="navbar-brand">Title</a>
              <ul className="nav navbar-nav">
                <li className="active">
                  <a>Home</a>
                </li>
                <li>
                  <a>Link</a>
                </li>
              </ul>
            </div>
          </nav> 
          <div>
            <h2>
              a : {a} <br/>
              b : {b} <br/>
              a + b = {a+b}
            </h2>
            <h3>
              name : {name}
            </h3>

            <h3>
              ID : {product.id}<br/>
              Name : {product.name}<br/>
              Price : {product.price}<br/>
            </h3>
          </div>
        </div> 
      );
  }

}

export default App;
